		this.setState({ sent: false });
	}
	g(data) {
		return (
			<button>
				<div>
					<h6>{data.name}</h6>
					<br />
					<small>{data.fee} Delivery Fee</small>
					<br />
					<small>{data.miles} Miles</small>
				</div>
			</button>);
	}
	servicesForm() {
		const restaurants = [{
			name: "Pizza Hut",
			fee: "$0.50",
			miles: 2,
		},
		{
